// src/components/Header.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Header = ({ user, logout }) => {
  return (
    <header class="bg-gradient-to-r from-blue-600 to-purple-600 text-white">
    <div class="container mx-auto px-6 py-4 flex justify-between items-center">
      {/* <!-- Logo --> */}
      <div class="flex items-center space-x-2">
        <img src="https://img.icons8.com/external-smashingstocks-detailed-outline-smashing-stocks/64/ffffff/external-book-bookstore-smashingstocks-detailed-outline-smashing-stocks.png" alt="Book Exchange Logo" class="h-10 w-10"/>
        <h1 class="text-2xl font-bold">Book Exchange</h1>
      </div>
      {/* <!-- Navigation Links --> */}
      <nav class="hidden md:flex space-x-8">
        <a href="#" class="hover:text-gray-200 transition duration-300">Home</a>
        <a href="#" class="hover:text-gray-200 transition duration-300">Browse Books</a>
        <a href="#" class="hover:text-gray-200 transition duration-300">My Profile</a>
        <a href="#" class="hover:text-gray-200 transition duration-300">Requests</a>
        <a href="#" class="hover:text-gray-200 transition duration-300">Logout</a>
      </nav>
      {/* <!-- Mobile Menu Button --> */}
      <button class="md:hidden text-white focus:outline-none">
        <svg xmlns="http://www.w3.org/2000/svg" class="h-8 w-8" fill="none" viewBox="0 0 24 24" stroke="currentColor">
          <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M4 6h16M4 12h16m-7 6h7" />
        </svg>
      </button>
    </div>
  </header>


  );
};

export default Header;
